import OutlinedInput from "@mui/material/OutlinedInput";
import InputLabel from "@mui/material/InputLabel";
import MenuItem from "@mui/material/MenuItem";
import FormControl from "@mui/material/FormControl";
import ListItemText from "@mui/material/ListItemText";
import Select, { SelectChangeEvent } from "@mui/material/Select";
import Checkbox from "@mui/material/Checkbox";
import { useState } from "react";
import { Container } from "./styles";
import React from "react";
import { filterData } from "../../utiles/filterData";

function SearchFilters({ property }: any) {
  const ITEM_HEIGHT = 48;
  const ITEM_PADDING_TOP = 8;
  const MenuProps = {
    PaperProps: {
      style: {
        maxHeight: ITEM_HEIGHT * 4.5 + ITEM_PADDING_TOP,
        width: 100,
      },
    },
  };
  const names: string[] = [
    "Oliver Hansen",
    "Van Henry",
    "April Tucker",
    "Ralph Hubbard",
    "Omar Alexander",
    "Carlos Abbott",
    "Miriam Wagner",
    "Bradley Wilkerson",
    "Virginia Andrews",
    "Kelly Snyder",
  ];
  const data = filterData;

  const [personName, setPersonName] = React.useState<string[]>([]);
  const [fitlers, setFitlers] = useState(filterData);

  const handleChange = (
    event: SelectChangeEvent<typeof personName>,
    label: any
  ) => {
    const {
      target: { value },
    } = event;

    setPersonName(
      // On autofill we get a stringified value.
      typeof value === "string" ? value.split(",") : value
    );
  };

  return (
    <Container>
      <div>
        {property ? (
          <h3> Searching Properties {property}</h3>
        ) : (
          <h3> Searching Properties</h3>
        )}
      </div>
      <>
        {fitlers.map((dataItem) => (
          <FormControl sx={{ m: 1, width: 300 }}>
            <InputLabel>{dataItem.placeholder}</InputLabel>

            <Select
              multiple
              value={personName}
              onChange={handleChange}
              input={<OutlinedInput label="Tag" />}
              renderValue={(selected) => selected.join(", ")}
              MenuProps={MenuProps}
            >
              {names.map((dataItem) => (
                <MenuItem key={dataItem} value={dataItem}>
                  <Checkbox checked={personName.indexOf(dataItem) > -1} />
                  <ListItemText primary={dataItem} />
                </MenuItem>
              ))}
            </Select>
          </FormControl>
        ))}
      </>
    </Container>
  );
}
export default SearchFilters;
